Documents related to the establishment of a health plan at GW. The documents include:
The original proposal, together with Dr. Elliott's letter;
The founding and related documents from the three pioneering medical schools:  1) the Harvard Community Health Plan, designed in cooperation with Blue Cross / Blue Shield to serve the metropolitan Boston community. (Exists today as the highly successful Harvard Pilgrim Health Care.  2) the Yale Health Plan, designed to serve the faculty and staff of Yale University.  3) the Johns Hopkins program, designed to serve the planned community in Columbia, Maryland;
Federal legislation and regulations involving the development of HMOs;
Necessary service agreements with organizations to include Blue Cross /Blue Shield  committed to providing recruitment into the health plan, and reinsurance against catastrophic loss to complex patients; and the District of Columbia commitment to prepay patients enrolled from the Medicaid-eligible population of the district;
Planning documents necessary to implement the health plan, and create the necessary separate corporation (entirely controlled by the University) to administer it;
Legal considerations and documents provided by Fred Vinson (of Reasoner, Davis, and Vinson), University attorney at the time.
